public class InnerTestCaseStepActionFactory(Action<Humidifier.AppTest.TestCaseTypes.StepAction> factoryAction = null) : SubResourceFactory<Humidifier.AppTest.TestCaseTypes.StepAction>
{

    internal InnerTestCaseCompareActionFactory CompareActionFactory { get; set; }

    internal InnerTestCaseMainframeActionFactory MainframeActionFactory { get; set; }

    internal InnerTestCaseResourceActionFactory ResourceActionFactory { get; set; }

    protected override Humidifier.AppTest.TestCaseTypes.StepAction Create()
    {
        var stepActionResult = CreateStepAction();
        factoryAction?.Invoke(stepActionResult);

        return stepActionResult;
    }

    private Humidifier.AppTest.TestCaseTypes.StepAction CreateStepAction()
    {
        var stepActionResult = new Humidifier.AppTest.TestCaseTypes.StepAction();

        return stepActionResult;
    }
    public override void CreateChildren(Humidifier.AppTest.TestCaseTypes.StepAction result)
    {
        base.CreateChildren(result);

        result.CompareAction ??= CompareActionFactory?.Build();
        result.MainframeAction ??= MainframeActionFactory?.Build();
        result.ResourceAction ??= ResourceActionFactory?.Build();
    }

} // End Of Class

